  const [courtData, setcourtData] = useState([]);

  useEffect(() => {
    getAllcourtData() // <-- Add this line
  }, []);
    const getAllcourtData = () => {
      try {
         AxiosInstance.get('/users/getAllcourtData').then((response)=>{
          console.log('Court data:', response.cou);
        setcourtData(response.data);
        });
        
      } catch (error) {
        console.log('Error in getting data', error);
      }
    };

   

  return (
    <>
      <MainNavBar />
      <div className='container'>
        <div className='row p-2 gap-3'>
          {courtData.map((court) => (
            <Cards  courts={court} />
          ))}
        </div>
      </div>

    
      {/* Your home component content */}
      <Footer />
    </>
  );
}

export default Home;
